import Container from "react-bootstrap/Container"
import {VerticalTimeline,  VerticalTimelineElement } from "react-vertical-timeline-component"
import "react-vertical-timeline-component/style.min.css"
import timelineElements from "./timelineElements"

export const Resume = () => { 
    const iconStyle = { background: 'black', width: '30px', height: '30px', borderRadius: '50%' };

    return (
        <Container className="timeline" id="resume"> 
            <VerticalTimeline>
                {timelineElements.map(element => (
                    <VerticalTimelineElement
                        key={element.id}
                        iconStyle={iconStyle}
                    >
                        <h3 className="vertical-timeline-element-title">{element.workplace}</h3>
                        <h4 className="vertical-timeline-element-title">{element.title}</h4>
                        <h5 className="vertical-timeline-element-title">{element.date}</h5>
                        <p className="vertical-timeline-element-title">{element.description}</p>
                        {element.button && <a className="timeline-element-button" href={element.button}>{element.buttonText}</a>}
                    </VerticalTimelineElement>
                ))}
            </VerticalTimeline>
        </Container>
    );
};
